The Invisible People

Sociopolitical Documentary hosted by Giles Duley, published by Channel 4 broadcasted as part of CH4 Unreported World series in 2014 - English narration


Information
------------------------------

Producer David Fuller and new reporter Giles Duley, a photographer who three years ago lost his legs and an arm to a landmine in Afghanistan, travel to Lebanon to reveal the plight of some of the most vulnerable refugees fleeing the war in Syria: disabled people, many of whom are children. Talking to the children, their families and the organisations trying to help them, Unreported World reveals how both they and the Lebanese government are struggling to cope as the crisis worsens.

